import React from "react";
import Todo from "../../components/Todo";
import INewItem from "../../types";
import { createStore } from "redux";

const initialState = {
  mainArray: [],
};

interface actions {
  type: string;
  payload: any;
}

const reducer = (
  state = initialState,
  { type, payload = {} }: actions
): any => {
  switch (type) {
    case "CHANGE_ARR":
      return [...state, {}];
  }
  return state;
};

const store = createStore(reducer);

const chengeArr = {
  type: "CHANGE_ARR",
  payload: ["asd"],
};
store.dispatch(chengeArr);

console.log(store.getState());

